import React from 'react';
import './styles/App.scss'; 
import Header from './components/Header'; // Importa o componente Header
import Hero from './components/Hero'; // Importa o componente Hero
import About from './components/About'; // Importa o componente About
import Portfolio from './components/Portfolio'; // Importa o componente Portfolio
import Contact from './components/Contact'; // Importa o componente Contact

const App: React.FC = () => {
    return (
        <div className="app">
            <Header />
            <Hero />
            <About />
            <Portfolio />
            <Contact />
        </div>
    );
};

export default App;
